from bs4 import BeautifulSoup
import requests

def get_html_text(url):
    html_text = requests.get(url).text
    soup = BeautifulSoup(html_text, "html.parser")
    return soup

def get_stars(url):
    soup = get_html_text(url)
    listahtml = soup.find("div", attrs={"class": "cast-list text-sluglist"}).find_all("a",
                                                                                      {"class": "text-slug tooltip"})
    star = []
    for x in listahtml:
        nombre_actor = x.text
        star.append(str(nombre_actor))
    return star

def get_director(url):
    soup = get_html_text(url)
    project_href = [i['href'] for i in soup.find_all('a', href=True)]
    director = []
    for x in project_href:
        if "/director/" in x:
            director_name = x.split("/director/")[1].replace("-", " ").title()
            director.append(str(director_name.strip('/')))

    return list(set(element for element in director))


def get_writers(url):
    soup = get_html_text(url)
    project_href = [i['href'] for i in soup.find_all('a', href=True)]
    director = []
    for x in project_href:
        if "/writer/" in x:
            director_name = x.split("/writer/")[1].replace("-", " ").title()
            director.append(str(director_name.strip('/')))
        if "/writers/" in x:
            director_name = x.split("/writers/")[1].replace("-", " ").title()
            director.append(str(director_name.strip('/')))

    return list(set(element for element in director))


def get_name(url):
    soup = get_html_text(url)
    listahtml = soup.find("h1", attrs={"class": "headline-1 js-widont prettify"})
    name = listahtml.text
    return name


def get_year(url):
    soup = get_html_text(url)
    small_element = soup.find('small', class_='number')
    year = small_element.find('a').text
    return year

movies = []
lista_python = ["https://letterboxd.com/film/meet-cute-2022/"]

for i, url in enumerate(lista_python):
    movies.append(
        {"name": get_name(url), "year": get_year(url),
         "directors": get_director(url),
         "writers": get_writers(url), "actors": get_stars(url)})

for movie in enumerate(movies):
    print(movie)


